import './App.css';
import Login from './components/Login';
import Error from './components/Error';
import React from 'react';
import Header from './components/Headers';
import StudentHome from './components/student/student_home';
import TeacherHome from './components/teacher/teacher_home';
import ProjectBank from './components/common/project_bank';
import StudentProfile from './components/student/student_profile';
import TeacherProfile from './components/teacher/teacher_profile';
import { Route, Routes } from 'react-router-dom'; // Remove unnecessary imports

function App() {
  return (
    <>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/StudentHome/:userId/*" element={<StudentApp />} />
        <Route path="/TeacherHome/:userId/*" element={<TeacherApp />} />
        <Route path="/StudentProfile/:userId/*" element={<StudentProfileWrapper />} />
        <Route path="/TeacherProfile/:userId/*" element={<TeacherProfileWrapper />} />
        <Route path= "/project_bank" element={<ProjectBank />} />
        <Route path="*" element={<Error />} />
      </Routes>
    </>
  );
}

// StudentApp component
function StudentApp() {
  const { userId } = useParams();
  return (
    <>
      <Header userId={userId} />
      <StudentHome />
    </>
  );
}

// TeacherApp component
function TeacherApp() {
  const { userId } = useParams();
  return (
    <>
      <Header userId={userId} />
      <TeacherHome />
    </>
  );
}

// StudentProfileWrapper component
function StudentProfileWrapper() {
  const { userId } = useParams();
  return (
    <>
      <Header userId={userId} />
      <StudentProfile />
    </>
  );
}

// TeacherProfileWrapper component
function TeacherProfileWrapper() {
  const { userId } = useParams();
  return (
    <>
      <Header userId={userId} />
      <TeacherProfile />
    </>
  );
}

export default App;
